// Nav.js

import React from 'react';
import { Link } from 'react-router-dom';
import Logo from '../Logo/Logo';
import { HamburgerSqueeze as NavBurger } from 'react-animated-burgers'
import NavMenu from './NavMenu/NavMenu';

const Nav = props => {
  // styles for the logo
  const logoStyles = { height: "50px" }

  // the open/close menu toggler
  const menuClassNameToggler = props.isOpen ? " Nav__menu--open" : "";

  return(

    <div
      className="Nav Nav--horizontal">

        {/* compiles to an anchor */}
        <Link
          className="Nav__logoLink"
          to="/"
          onClick={props.onLogoClick}>
          <Logo style={{ height: "50px" }} />
        </Link>

        {/* compiles to a button */}
        <NavBurger
          className="Nav__burger"
          isActive={props.isOpen} 
          barColor="white"
          toggleButton={props.onClick}
          buttonStyle={{ padding: "0" }}
          buttonWidth={36}
        />

        <ul className="NavMenu__list">
          <li className="NavMenu__listItem">
            <Link 
              to="/" 
              className="NavMenu__anchor" 
              onClick={props.onClick}> 
                <i className="material-icons-round md-24 md-light">home</i>
                <span className="NavMenu__anchorText">Forside</span>
            </Link>
          </li>
          <li className="NavMenu__listItem">
            <Link
              to="/about"
              className="NavMenu__anchor" 
              onClick={props.onClick}>
              <i className="material-icons-round md-24 md-light">groups</i>
              <span className="NavMenu__anchorText">Om os</span>
            </Link>
          </li>
          <li className="NavMenu__listItem">
            <Link
              to="/partners"
              className="NavMenu__anchor" 
              onClick={props.onClick}>
              <i className="material-icons-round md-24 md-light">add_business</i>
              <span className="NavMenu__anchorText">Partners</span>
            </Link>
          </li>
        </ul>

        <div className={"Nav__menu" + menuClassNameToggler}>
          <NavMenu 
            isOpen={props.isOpen}
            onClick={props.onClick}
          />
        </div>

    </div>
  )
}


export default Nav;
